import React from 'react';
import styled from '@emotion/styled';

const TodoHeader = () => {
  return (
    <TodoHeaderStyled>
      <div className='hero'>
        <span>TODO APE</span>
        <input type='text' placeholder='Search ...' />
        <button>Search</button>
      </div>
      <input types='text' />
    </TodoHeaderStyled>
  );
};

const TodoHeaderStyled = styled.div`
  .hero {
    display: flex;
    align-items: center;
    font-size: 20px;
    line-height: 20px;
    font-weight: 700;

    span {
      white-space: nowrap;
      margin-right: 20px;
    }

    input {
      border-radius: 5px;
      height: 50px;
      padding: 0 20px;
    }

    button {
      height: 50px;
    }
  }
`;

export default TodoHeader;
